import React from 'react';
import { Tab } from 'semantic-ui-react';
import getData from '../util/getData.js';
import AllDegrees from './AllDegrees.js';


export default class DegreeTabs extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            degrees: {},
            loaded: false
        }
    }

    render(){
        const paneData = [
            {
              title: 'Graduate',
              group: degrees.graduate
            },
            {
              title: 'Undergraduate'
            }
          ];

          const panes = paneData.map(({ title, group }, index) => {
            const renderPane = (title, key, degGroup) => {
              return (
                <div className='tab'>
                  <Tab.Pane>
                    <AllDegrees
                      activeClass="activeTab"
                      key={key}
                      title={title}
                      degGroup={degGroup}
                    />
                  </Tab.Pane> 
                </div>
              );
            };

            return {
              menuItem: title,
              render: renderPane(menuItem, index, group)
            }
          });
    }

    componentDidMount(){
        getData('degrees/')
            .then((json) => {
                this.setState({
                    degrees:json,
                    loaded: true
                })
            })
    }
}
